import React from 'react'
import './Portfolio.css'
import {Swiper,SwiperSlide} from 'swiper/react';
import 'swiper/css';

import AvsH from "../../img/AvsH.png";
import Directors1 from "../../img/Directors1.jpg";
import GAMING from "../../img/GAMING.jpg";
import Scary from "../../img/Scary.jpg";
import RichPoor from "../../img/RichPoor.jpg";
import Trumpp from "../../img/Trumpp.jpg"


export const Portfolio=()=>{
    return (
        <div className="portfolio">
               
               <span>Recent Projects</span>
               <span>Thumbnails</span>


                <Swiper
              
                spaceBetween={0}
                slidesPerView={3}
                grabCursor={true}
                className='portfolio-slider'
                >
    <SwiperSlide>
        <img src={Scary} alt=""/>
    </SwiperSlide>
    <SwiperSlide>
        <img src={AvsH} alt=""/>
    </SwiperSlide>
  

                </Swiper>

                <Swiper
              
              spaceBetween={0}
              slidesPerView={3}
              grabCursor={true}
              className='portfolio-slider'
              >
  
  <SwiperSlide>
      <img src={RichPoor} alt=""/>
  </SwiperSlide>
  <SwiperSlide>
      <img src={GAMING} alt=""/>
  </SwiperSlide>
  

              </Swiper>

            </div>
        )
}
